window.bookSummaryJSON = "<p>There's an arctic chill on the horizon, and I'm headed straight into it.</p> <p>My friends are missing, and the Sons of Adam may be responsible.</p> <p>It's an obvious trap to snare me. Still, sitting back and allowing others to take the lead is the hardest decision of all. I'm a woman of action, and waiting isn't my strong suit. But knowing Jasper and Conah are on the case helps. It's the smart choice, right?</p> <p>But when my connection to Jasper suddenly dies, waiting around is no longer an option.</p> <p>The Sons of Adam have maintained the upper hand for too long.</p> <p>It's time to take the fight to them. I just hope I'm not too late.</p> <p>Contains mature themes.</p>"; 
